import React from 'react';
import { Switch, Route, HashRouter } from 'react-router-dom';

import Icecek from './pages/icecek';
import Tatli from './pages/tatli';
import Yemek from './pages/yemek';
import Home from './pages/anasayfa';
import support from './pages/support';

const Main = () => {
  return (
    <Switch> {/* The Switch decides which component to show based on the current URL.*/}
      
      <HashRouter exact path='/yemek' component={Yemek}></HashRouter>
      <HashRouter exact path='/tatli' component={Tatli}></HashRouter>
      <HashRouter exact path='/icecek' component={Icecek}></HashRouter>
      <HashRouter exact path='/support' component={support}></HashRouter>
      <HashRouter exact path='/' component={Home}></HashRouter>
    </Switch>
  );
}

export default Main;
